import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import Login from './pages/Login';
import Signup from './pages/Signup';
import LocatorPage from './pages/LocatorPage';
import SymptomCheckerPage from './pages/SymptomCheckerPage';
import Settings from './pages/Settiings';
import './assets/styles/main.css';

const App = () => {
  const [user, setUser] = useState(null);

  useEffect(() => {
    const fetchedUser = localStorage.getItem('user');
    if (fetchedUser) {
      setUser(JSON.parse(fetchedUser));
    }
  }, []);

  const logout = () => {
    localStorage.removeItem('user');
    setUser(null);
  };

  const ProtectedRoute = ({ element }) => {
    return user ? element : <Navigate to="/login" />;
  };

  return (
    <Router>
      <div className="app-container">
        {/* Sidebar */}
        <nav className="sidebar">
          <ul>
            <li>
              <Link to="/">Dashboard</Link>
            </li>
            <li>
              <Link to="/locator">Locator</Link>
            </li>
            <li>
              <Link to="/symptoms">Symptom Checker</Link>
            </li>
            {user ? (
              <>
                <li>
                  <Link to="/settings">Settings</Link>
                </li>
                <li>
                  <button onClick={logout}>Logout</button>
                </li>
              </>
            ) : (
              <>
                <li>
                  <Link to="/login">Login</Link>
                </li>
                <li>
                  <Link to="/signup">Signup</Link>
                </li>
              </>
            )}
          </ul>
        </nav>

        {/* Main Content */}
        <div className="main-content">
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/locator" element={<LocatorPage />} />
            <Route path="/symptoms" element={<SymptomCheckerPage />} />
            <Route path="/settings" element={<ProtectedRoute element={<Settings user={user} />} />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
